import React from 'react';
import Navbar from '../Home/Navbar';
import Footer from '../Home/Footer';


const Account = () => {
    return (
        <>
            <Navbar />

            <div className='hero'>
                <div className='hero-col'>
                <img src={require('../images/back.png')} alt='homebackground' />
                
                </div>
                <div className='hero-col'>
                   </div>
            </div>

            <Footer />
        </>
    )
}

export default Account;
